import React, { useState } from "react";
import { List } from "react-bootstrap-icons";
import { Link } from "react-router-dom"
import logo from "../image/company-logo.png";

function Header() {

  const [navlink,setnavlink]=useState(false)
  const[navlink2 ,setnavlink2]=useState(false)

  const sitelink=()=>{
       setnavlink(!navlink)
  }
  const sitelink2=()=>{
    setnavlink2(!navlink2)
}
  return (
    <div>
      <nav>
        <div className="nav-view">
          <div className="container">
            <div className="row">
              <div className="col-md-6">
                <div className="logo">
                  <img src={logo} className="img-fluid" />
                </div>
              </div>
              <div className="col-md-6">
                <div className="nav-list">
                  <ul className="nav-types">
                    <Link to="/">
                      {" "}
                      <li onClick={sitelink} className={navlink === true ? "active":"active2"}>Home</li>
                    </Link>
                    <Link to="/about">
                      {" "}
                      <li onClick={sitelink} className={navlink === true ? "active2":"active"}>About Us</li>
                    </Link>
                    <Link to="/project">
                      {" "}
                      <li onClick={sitelink2} className={navlink2 === true ? "active2":"active"} >Project</li>
                    </Link>
                    <Link to="carrer">
                      <li onClick={sitelink} className={navlink === true ? "active":"active2"}>Carrer</li>
                    </Link>
                    <Link to="contactus">
                      {" "}
                      <li>Contact Us</li>
                    </Link>
                  </ul>
                </div>

                <div className="mobile-nav">
                  <div className="menu-bar">
                    <List />
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </nav>
    </div>
  );
}

export default Header;
